    function pengunjung($edisi="") {  
		// if(checkCurrentMenubyUserGroup()=="no") redirect(url_admin(), 'refresh'); 
		$submit			 = $this->input->post('submit'); 
		$data['month']	 = $this->input->post('month'); 
		if (!empty($submit)){ 
			$tgl 	= explode(' to ',$data['month']);
			$start 	= explode('-',$tgl[0]);
			$end 	= explode('-',$tgl[1]);
			$tglawal 	= $start[2]."-".$start[1]."-".$start[0]." 00:00:00";
			$tglakhir 	= $end[2]."-".$end[1]."-".$end[0]." 23:59:59"; 	
			$dates = "'".$tglawal."' and '".$tglakhir."'";

			$data['jurusan'] = $this->Anggotamodel->getallProdi()->result();
			$no=1;
			foreach($data['jurusan'] as $row) {
				$data['day'][$no]		= $this->Anggotamodel->getJumlahPenunjungByTanggal($row->c_kode_prodi,$dates,'day')->row()->total; 
				$data['night'][$no]		= $this->Anggotamodel->getJumlahPenunjungByTanggal($row->c_kode_prodi,$dates,'night')->row()->total; 
				$no++;
			}  
			$data['day'][$no]		= $this->Anggotamodel->getJumlahPengunjungDosenPegawaiByTanggal($dates,'day')->row()->total; 
			$data['night'][$no]		= $this->Anggotamodel->getJumlahPengunjungDosenPegawaiByTanggal($dates,'night')->row()->total; 
			 
			$no++;
			$data['day'][$no]		= $this->Anggotamodel->getJumlahPengunjungPublicByTanggal($dates,'day')->row()->total; 
			$data['night'][$no]		= $this->Anggotamodel->getJumlahPengunjungPublicByTanggal($dates,'night')->row()->total;
		
		}else{
			$data['jurusan'] = $this->Anggotamodel->getallProdi()->result();
			$no=1;
			
			$dates = "'".date('Y-m')."-01' and '".date('Y-m-d')."'";
			foreach($data['jurusan'] as $row) {
				$data['day'][$no]		= $this->Anggotamodel->getJumlahPenunjungByTanggal($row->c_kode_prodi,$dates,'day')->row()->total; 
				$data['night'][$no]		= $this->Anggotamodel->getJumlahPenunjungByTanggal($row->c_kode_prodi,$dates,'night')->row()->total; 
				$no++;
			}  
			$data['month'] = date('m-Y');
			$data['day'][$no]		= $this->Anggotamodel->getJumlahPengunjungDosenPegawaiByTanggal($dates,'day')->row()->total; 
			$data['night'][$no]		= $this->Anggotamodel->getJumlahPengunjungDosenPegawaiByTanggal($dates,'night')->row()->total; 
			
			$data['month'] = "01-".date('m-Y')." to ".date('d-m-Y');
			$no++;
			$data['day'][$no]		= $this->Anggotamodel->getJumlahPengunjungPublicByTanggal($dates,'day')->row()->total; 
			$data['night'][$no]		= $this->Anggotamodel->getJumlahPengunjungPublicByTanggal($dates,'night')->row()->total; 
		}
		// echo "<pre>";
		// print_r($data['day'][$no]);
		// echo "</pre>";
		$data['menu'] 	= 'anggota/pengunjung'; 
		$this->load->view('theme', $data);
    } 
	
	public function excel()
	{ 
		$month	 = $this->input->post('month'); 
		$prodi	 = $this->input->post('prodi'); 
		if($prodi=='dospeg'){
			$day		= $this->Anggotamodel->getListPengunjungDosenPegawaiByTanggal($month,'day')->result(); 
			$night		= $this->Anggotamodel->getListPengunjungDosenPegawaiByTanggal($month,'night')->result();
			$name 		= "Dosen dan Pegawai";
		}
		else if($prodi=='public'){
			$day		= $this->Anggotamodel->getListPengunjungPublicByTanggal($month,'day')->result(); 
			$night		= $this->Anggotamodel->getListPengunjungPublicByTanggal($month,'night')->result();
			$name 		= "Public";
		}
		else {
			$prodis 	= $this->BahanPustakaModel->getStudyProgram($prodi)->row();
			$name 		= "Prodi ".$prodis->nama_prodi;
			$day		= $this->Anggotamodel->getListPenunjungByTanggal($prodi,$month,'day')->result(); 
			$night		= $this->Anggotamodel->getListPenunjungByTanggal($prodi,$month,'night')->result(); 
		}
		$objPHPExcel = new PHPExcel();
		$objPHPExcel->getProperties()->setTitle("Pengunjung")
						 ->setDescription("description");			
		  
		
		
		$objPHPExcel->getActiveSheet()->setCellValue('A1', $name);
		
		
		$objPHPExcel->getActiveSheet()->setCellValue('A4', 'NAMA');
		$objPHPExcel->getActiveSheet()->setCellValue('B4', 'NIM/NIP');
		$objPHPExcel->getActiveSheet()->setCellValue('C4', 'UNIT');
		$objPHPExcel->getActiveSheet()->setCellValue('D4', 'DATE');
		$objPHPExcel->getActiveSheet()->setCellValue('E4', 'SHIFT');
		$objPHPExcel->getActiveSheet()->setCellValue('H4', 'NAMA');
		$objPHPExcel->getActiveSheet()->setCellValue('I4', 'NIM/NIP');
		$objPHPExcel->getActiveSheet()->setCellValue('J4', 'UNIT');
		$objPHPExcel->getActiveSheet()->setCellValue('K4', 'DATE');
		$objPHPExcel->getActiveSheet()->setCellValue('L4', 'SHIFT');
		$i 		= 5; 
		
		foreach($day as $days){
			// echo $days->master_data_user." ";;
			$member = $this->Anggotamodel->getNim($days->master_data_user)->row(); 
			$objPHPExcel->getActiveSheet()->setCellValue('A'.$i, $days->master_data_fullname.' ('.$days->master_data_user.')');
			$objPHPExcel->getActiveSheet()->setCellValue('B'.$i, $days->master_data_number);
			$objPHPExcel->getActiveSheet()->setCellValue('C'.$i, ($member?$member->unit:''));
			$objPHPExcel->getActiveSheet()->setCellValue('D'.$i, $days->attended_at); 
			$objPHPExcel->getActiveSheet()->setCellValue('E'.$i, '08:00-16.30');
			$i++;  
		
		}
		$i 		= 5;
		foreach($night as $nights){
			// echo $days->master_data_user." ";;
			$member = $this->Anggotamodel->getNim($nights->master_data_user)->row(); 
			$objPHPExcel->getActiveSheet()->setCellValue('H'.$i, $nights->master_data_fullname.' ('.$nights->master_data_user.')');
			$objPHPExcel->getActiveSheet()->setCellValue('I'.$i, $nights->master_data_number);
			$objPHPExcel->getActiveSheet()->setCellValue('J'.$i, ($member?$member->unit:''));
			$objPHPExcel->getActiveSheet()->setCellValue('K'.$i, $nights->attended_at); 
			$objPHPExcel->getActiveSheet()->setCellValue('L'.$i, '16:30-19.30');
			$i++;  
		
		}
		$objPHPExcel->setActiveSheetIndex(0);

		// Save it as an excel 2003 file
		$objWriter = PHPExcel_IOFactory::createWriter($objPHPExcel, 'Excel2007');
		//$objWriter->save('php://output');str_replace("world","Peter","Hello world!");
		$filePath = 'downloads/'.str_replace(" ","_",$name).'.xlsx';
		$objWriter->save($filePath);
		echo $filePath;
	}
	
	function sirkulasi($edisi="") {
		// if(checkCurrentMenubyUserGroup()=="no") redirect(url_admin(), 'refresh'); 
		$submit			 = $this->input->post('submit'); 
		$data['month']	 = $this->input->post('month'); 
		if (!empty($submit)){ 
			$data['jurusan'] = $this->Anggotamodel->getallProdi()->result();
			$no=1;  
			foreach($data['jurusan'] as $row) { 
				$data['download'][$no] 		= $this->Anggotamodel->getJumlahDownloadByTanggal($row->c_kode_prodi,$data['month'])->row(); 
				$data['pinjam'][$no]		= $this->Anggotamodel->getJumlahPeminjamanByTanggal($row->c_kode_prodi,$data['month'])->row(); 
				$data['kembali'][$no]		= $this->Anggotamodel->getJumlahPengembalianByTanggal($row->c_kode_prodi,$data['month'])->row(); 
				$no++;
			}  
			$data['download'][$no] 		= $this->Anggotamodel->getJumlahDownloadNonMahasiswaByTanggal($data['month'])->row(); 
			$data['pinjam'][$no]		= $this->Anggotamodel->getJumlahPeminjamanNonMahasiswaByTanggal($data['month'])->row(); 
			$data['kembali'][$no]		= $this->Anggotamodel->getJumlahPengembalianNonMahasiswaByTanggal($data['month'])->row(); 
		
		}
		else {
			$data['month'] = date('m-Y');
			$data['jurusan'] = $this->Anggotamodel->getallProdi()->result();
			$no=1;
			foreach($data['jurusan'] as $row) { 
				$data['download'][$no] 		= $this->Anggotamodel->getJumlahDownloadByTanggal($row->c_kode_prodi,$data['month'])->row(); 
				$data['pinjam'][$no]		= $this->Anggotamodel->getJumlahPeminjamanByTanggal($row->c_kode_prodi,date('m-Y'))->row(); 
				$data['kembali'][$no]		= $this->Anggotamodel->getJumlahPengembalianByTanggal($row->c_kode_prodi,date('m-Y'))->row(); 
				$no++;
			}  
			$data['download'][$no] 		= $this->Anggotamodel->getJumlahDownloadNonMahasiswaByTanggal($data['month'])->row(); 
			$data['pinjam'][$no]		= $this->Anggotamodel->getJumlahPeminjamanNonMahasiswaByTanggal(date('m-Y'))->row(); 
			$data['kembali'][$no]		= $this->Anggotamodel->getJumlahPengembalianNonMahasiswaByTanggal(date('m-Y'))->row(); 
		}
		$data['menu'] 	= 'anggota/sirkulasi'; 
		$this->load->view('theme', $data);
    } 
	
	
